// SPDX-License-Identifier: MIT
pragma solidity 0.8.16;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

contract BetPool {
    using SafeERC20 for IERC20;

    struct BetPoolStruct {
        address owner;
        uint8 leftScore;
        uint8 rightScore;
    }
    mapping(address => string) private names;
    mapping(uint256 => BetPoolStruct) private bets;
    uint256 private betCounter;
    uint256 private endDate;

    uint256 private amount;
    address private token;

    address public ownerPendingClaim;
    address public owner;

    bool private initialized = false;

    event onBet(string _name, address _owner, uint8 _scoreLeft, uint8 _scoreRight);
    event onBetResolved(uint256 _winners, uint256 _unitPrize);
    event NewOwnershipProposed(address _currentOwner, address _proposedOwner);
    event OwnershipTransferred(address _previousOwner, address _newOwner);

    constructor(uint256 _defaultAmount, address _defaultToken, uint256 _endDate) {
        amount = _defaultAmount;
        token = _defaultToken;
        endDate = _endDate;
        owner = msg.sender;
    }

    function bet(string memory _name, uint8 _leftScore, uint8 _rightScore) external {
        require(block.timestamp >= endDate, "EventFinished");

        IERC20(token).safeTransferFrom(msg.sender, address(this), amount);
        if (bytes(names[msg.sender]).length == 0) names[msg.sender] = _name;

        betCounter++;
        bets[betCounter] = BetPoolStruct({
            owner: msg.sender,
            leftScore: _leftScore,
            rightScore: _rightScore
        });

        emit onBet(_name, msg.sender, _leftScore, _rightScore);
    }

    function getBetData(uint256 _index) external view returns (string memory _name, address _owner, uint8 _leftScore, uint8 _rightScore) {
        BetPoolStruct memory betPool = bets[_index];
        _name = names[betPool.owner];
        _owner = betPool.owner;
        _leftScore = betPool.leftScore;
        _rightScore = betPool.rightScore;
    }

    function getBets() external view returns (uint256) {
        return betCounter;
    }

    function resolveBet(uint8 leftScore, uint8 rightScore) external {
        require(msg.sender == owner, "OnlyOwner");

        address[] memory winners = new address[](betCounter);
        uint256 numWinners = 0;
        for (uint256 i=0; i<betCounter; i++) {
            BetPoolStruct memory betPool = bets[i];
            if ((betPool.leftScore == leftScore) && (betPool.rightScore == rightScore)) {
                winners[numWinners] = betPool.owner;
                numWinners++;
            }
        }

        uint256 unitPrize = 0;
        if (numWinners > 0) {
            uint256 totalPriceToShare = IERC20(token).balanceOf(address(this)) * 95 / 100;
            unitPrize = totalPriceToShare / numWinners;
            for (uint256 i=0; i<numWinners; i++) IERC20(token).safeTransfer(winners[i], unitPrize);
        }

        emit onBetResolved(numWinners, unitPrize);
    }

    function setAmountAndToken(uint256 _amount, address _token) external {
        require(msg.sender == owner, "OnlyOwner");
        amount = _amount;
        token = _token;
    }

    function proposeChangeOwner(address _owner) external {
        require(msg.sender == owner, "OnlyOwner");
        require(_owner != address(0), "ZeroAddress");
        ownerPendingClaim = _owner;

        emit NewOwnershipProposed(msg.sender, _owner);
    }

    function claimOwnership() external {
        require(msg.sender == ownerPendingClaim, "OnlyProposedOwner");
        ownerPendingClaim = address(0);
        address oldOwner = owner;
        owner = msg.sender;

        emit OwnershipTransferred(oldOwner, owner);
    }
}
